$(function(){$("#top").load("../common/common.html"),$("#submitBtn").click(function(){function p(s){return s<10?"0"+s:s}function GetNowTime(){var myDate=new Date,year=myDate.getFullYear(),month=myDate.getMonth()+1,date=myDate.getDate(),h=myDate.getHours(),m=myDate.getMinutes(),s=myDate.getSeconds();return year+"-"+p(month)+"-"+p(date)+" "+p(h)+":"+p(m)+":"+p(s)}let requireData=$.md5("mixiusi"+GetNowTime());$("#hide").attr("value",requireData);let newData=$("#feedbackForm").serialize();$.ajax({type:"POST",url:"http://mixiusi.com.cn:8081/feedback/addFeedback",data:newData,success:function(result){window.location.href="./site/submit_success/submitSucseccfully.html"}})})});